import React from 'react';
import './index.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-column">
        <h3>Column 1</h3>
        <p>Content for column 1</p>
      </div>
      <div className="footer-column">
        <h3>Column 2</h3>
        <p>Content for column 2</p>
      </div>
      <div className="footer-column">
        <h4>Column 3</h4>
        <p>Content for column 3</p>
      </div>
      <div className="footer-column">
        <h4>Column 4</h4>
        <p>Content for column 4</p>
      </div>
    </footer>
  );
};

export default Footer;
